const Card = ({name, address, details, offers}) => {
    return (
        <div className='card'>
            <img src="" alt="" />
            <div className="card__info">
                 <h2>{name}</h2>
                 <h4>{address}</h4>
                 <h3>{details}</h3>
                 
            </div>
        </div>
    )
}

export default Card
